import './App.css';

function App() {
  const numarr = [[1,2,3],[4,5,6],[7,8,9]];
  return (
    <div>
      <h1>Calculator App</h1>
      <div>
        <span>1</span>
        <span>2</span>
        <span>3</span>
      </div>
     </div>
  );
}

export default App;
